window.onload=()=>{var e=document.getElementById("Donut").getContext("2d"),e=(new Chart(e,{type:"doughnut",data:{labels:["United states","Poland","Italy","Germany","Other"],datasets:[{label:"Analysis",data:[20,40,13,35,20,38],backgroundColor:["#3993bb","#65b5c2","#2e7bad","#23649e","#63daed"],hoverOffset:5}]},options:{responsive:!1}}),document.getElementById("wavyChart").getContext("2d"));new Chart(e,{type:"line",data:{labels:[25,50,75,100,125,150,175,200,225,250],datasets:[{label:"Statistics",borderColor:"#4aa59f",backgroundColor:"#86d3ce",data:[2,3,17,12,55,15,28.5,10,3,2],fill:!0,lineTension:.4}]},options:{responsive:!1,maintainAspectRatio:!1,scales:{x:[{grid:{display:!0}}],y:[{grid:{drawBorder:!1,color:function(e){return e.tick.value<50?"rgba(255, 0, 0, 0.5)":null}}}]}}})};